sys_variable_value.value:
(function execute(inputs, outputs) {

  try {
    const result = JSON.parse(inputs.response_body).result;
    if (result.links) {
	    outputs.progress_id = result.links.progress.id;
    }

    outputs.status = result.status;
    outputs.status_label = result.status_label;
    outputs.error = result.error;
  } catch (e) {

  }

})(inputs, outputs);

